import React from 'react';
import { Form } from 'react-bootstrap';

import '../App.css';


{/* Contact page */}

function Contact() {
    return (
        <div>
            <Form>
            <Form.Row>
                <Form.Group controlId="formGridEmail">
                <Form.Label>Email</Form.Label>
                <Form.Control type="email" placeholder="Enter email" />
                </Form.Group>
            </Form.Row>
            </Form>
        </div>
    );
}

export default Contact;
